import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import './App.css';
import './App.css';
import Aos from 'aos';
import Homepage from './landing_page/homepage';

Aos.init({
  duration: 1000,
  easing: 'ease-in-out',
  once: true,
  mirror: false
});

function App() {
  return (
    <>
   <Router>
    <Switch>
       <Route exact path="/" component={Homepage}/>
    </Switch>


   </Router>

    </>
  );
}

export default App;
